  return (

    <Card style={{width: "18rem"}}>
 <div className="center">
    {projects.map((project, key) => (

      <Project
        key = {key}
        name={project.name}
        src={project.src}
        git={project.git}
        live={project.live}
      />

    ))}
      </div>
  </Card>

  )
}
